// DeleteUniqueIndexCache 删除索引存在的缓存
func (m *MallProductRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.MallProduct) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, m.cache.Key(CacheMallProductByConditionPrefix))
	keys = append(keys, m.cache.Key(CacheMallProductUnscopedByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[m.cache.Key(CacheMallProductByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductUnscopedByIDPrefix, item.ID)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductByProductTypePrefix, item.ProductType)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductUnscopedByProductTypePrefix, item.ProductType)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductBySortPrefix, item.Sort)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductUnscopedBySortPrefix, item.Sort)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductByStatusPrefix, item.Status)] = struct{}{}
			KeyMap[m.cache.Key(CacheMallProductUnscopedByStatusPrefix, item.Status)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := m.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
